import React from 'react'
const Navbar = () => {

  return(
    <div className="container">
    <nav className="navbar fixed-top navbar-light bg-dark">
    <h1 className="">Blog BTS</h1>
    <button className="btn btn-outline-success my-2 my-sm-0">Iniciar sesion </button>
    </nav>
    </div>
    )
  }

  export default Navbar;
